import React, { Component } from "react";
import { Row, Col, Card, Avatar, Tabs, Form, Icon, Input, Button, Checkbox, Typography} from "antd";
const { TabPane } = Tabs;
class AddUser extends Component {

   constructor(props) {
    super(props);
    this.state = {
     userName:'',
     userId:'',
     errorMsg:'',
     Account_type:''
    }
 }
    render () {
        const formItemLayout = {
            labelCol: {
            xs: { span: 24 },
            sm: { span: 8 },
            },
            wrapperCol: {
            xs: { span: 24 },
            sm: { span: 16 },
            },
        };
        const tailFormItemLayout = {
            wrapperCol: {
            xs: {
                span: 24,
                offset: 0,
            },
            sm: {
                span: 16,
                offset: 8,
            },
            },
        };
        const { getFieldDecorator } = this.props.form;
   return(
     <div>
        <div id="content">
          <Row gutter={24} type="flex">
            <Col span={16} className="c-mb">
              <Card
                bordered={false}
                className="mi-card mi-card-boxshadow mi-card-user-setting"
              >
                    <div className="tabpane-inside-gutters">
                    <Row type="flex" justify="">
                        <Col span={16}>

                         <div className="page-header">
                          <Row type="flex" justify="space-between">
                                <Col>
                                  <h3 lassName="page-heading" ></h3>
                                </Col>
                          </Row>
                      </div>
             <Form  {...formItemLayout}>

                <Row>
                    <Col span={16} offset={8}>
                       <div class="ant-card-head-wrapper">
                        <h5 class="ant-card-head-title">Create User</h5>
                       </div>
                    </Col>
                </Row>
                <Form.Item label="First Name">
                    {getFieldDecorator('fname')(<Input />)}
                </Form.Item>
                <Form.Item label="Last Name">
                    {getFieldDecorator('lname')(<Input />)}
                </Form.Item>
                <Form.Item label="Username">
                    {getFieldDecorator('username')(<Input />)}
                </Form.Item>
                <Form.Item label="UserRights">
                    {getFieldDecorator('user_rights')(<Input />
                    )}
                    <select class="custom-select">
                     <option>Test1</option>
                     <option>Test2</option>
                     <option>Test3</option>
                     <option>Test4</option>

                </select>
                </Form.Item>
                <Form.Item label="Password">
                    {getFieldDecorator('password')(<Input />)}
                </Form.Item>
                <Form.Item label="Office Phone">
                    {getFieldDecorator('officePhone')(<Input />)}
                </Form.Item>
                <Form.Item label="Cell Phone">
                    {getFieldDecorator('cellPhone')(<Input />)}
                </Form.Item>
                <Form.Item label="Home Phone">
                    {getFieldDecorator('homePhone')(<Input  value='hi'/>)}
                </Form.Item>
                <Form.Item label="Email">
                    {getFieldDecorator('email')(<Input  value='hi'/>)}
                </Form.Item>

                <Row>
                    <Col span={16} offset={8}>
                        <h6 className="mb-3">Address</h6>
                    </Col>
                </Row>
                <Form.Item label="Address 1">
                    {getFieldDecorator('address_1')(<Input />)}
                </Form.Item>
                <Form.Item label="Address 2">
                    {getFieldDecorator('address_2')(<Input />)}
                </Form.Item>
                <Form.Item label="City">
                    {getFieldDecorator('city')(<Input />)}
                </Form.Item>
                <Form.Item label="State">
                    {getFieldDecorator('state')(<Input />)}
                </Form.Item>
                <Form.Item label="Zip Code">
                    {getFieldDecorator('zipCode')(<Input />)}
                </Form.Item>
                <Form.Item {...tailFormItemLayout}>
                    <Button type="primary" htmlType="submit">
                        Register
                    </Button>
                </Form.Item>

            </Form>
                      </Col>
                    </Row>
                </div>
              </Card>
            </Col>
          </Row>
        </div>
      </div>
    );
  }
}
const WrappedAddUser = Form.create()(AddUser);
export default WrappedAddUser;
